package swa.manage.entity;import swa.manage.value.ValidEnum;import java.io.Serializable;import java.util.Date;/** * StaffRecord:人员预定记录表 * Created by jinyan.cao on 2017-07-03 17:47:53 */public class StaffRecord implements Serializable {    private static final long serialVersionUID = 1969034612439931602L;    /**     * 自增主键     */    private Long id;    /**     * 预定日期     */    private Date date;    /**     * 预定开始时间     */    private String reserveTime;    /**     * 编码:layer-pid     */    private Long configId;    /**     * 是否已取消：0-取消，1-未取消     */    private ValidEnum validStatus;    /**     * 预订人姓名     */    private String staffName;    /**     * 预定用途     */    private String comment;    /**     * 操作人用户名     */    private String userName;    /**     * 创建时间     */    private Date createTime;    /**     * 更新时间     */    private Date updateTime;    public Long getId() {        return this.id;    }    public void setId(Long id) {        this.id = id;    }    public Date getDate() {        return this.date;    }    public void setDate(Date date) {        this.date = date;    }    public String getReserveTime() {        return reserveTime;    }    public void setReserveTime(String reserveTime) {        this.reserveTime = reserveTime;    }    public ValidEnum getValidStatus() {        return validStatus;    }    public void setValidStatus(ValidEnum validStatus) {        this.validStatus = validStatus;    }    public Long getConfigId() {        return configId;    }    public void setConfigId(Long configId) {        this.configId = configId;    }    public String getStaffName() {        return this.staffName;    }    public void setStaffName(String staffName) {        this.staffName = staffName;    }    public String getComment() {        return this.comment;    }    public void setComment(String comment) {        this.comment = comment;    }    public Date getCreateTime() {        return this.createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public String getUserName() {        return userName;    }    public void setUserName(String userName) {        this.userName = userName;    }    public Date getUpdateTime() {        return this.updateTime;    }    public void setUpdateTime(Date updateTime) {        this.updateTime = updateTime;    }    @Override    public String toString() {        return "StaffRecord{" +                "id=" + id + '}';    }}